<html>
	<head>
	</head>
	<body>
		<h2>Array elements</h2>
		<div id="a"></div>
		<script>
			var ar=[9, 5, 3, 4, 15, 26, 18, 12, 95, 68, 55, 24, 66, 35, 77, 63, 96, 10, 6];
			var obj=document.getElementById("a");
			var temp='';
			for (var i = 0; i < ar.length; i++) {
				temp=temp+ar[i]+'<br/>';
			}
			obj.innerHTML=temp;
		</script>
	</body>
</html>
